package com.algorithm.contest.weeklycontest199;

public class MinFlips {

    public static void main(String[] args) {
//        String s = "";
//        String s = "10111";
//        String s = "101";
//        String s = "00000";
        String s = "001011101";
        System.out.println(minFlipsII(s));
    }

    public static int minFlipsII(String target) {
        int ans = 0, res = 0, n = target.length();
        for (int i = 0; i < n; i++) {
            char c = target.charAt(i);
            if (c - '0' != ans) {
                ans = ans ^ 1;
                res++;
            }
        }
        return res;
    }

    public static int minFlips(String target) {
        int res = 0;
        if (toInt(target) == 0) {
            return res;
        }

        int n = target.length();
        while (toInt(target) != 0) {
            int changeInd = n - 1;
            for (int i = n - 1; i >= 0; i--) {
                if (i > 0 && target.charAt(i) != target.charAt(i - 1)) {
                    changeInd = i;
                    break;
                } else {
                    changeInd = i;
                }
            }
            String afterSwith = swith(target.substring(changeInd));
            target = target.substring(0, changeInd) + afterSwith;
            res++;
        }
        return res;
    }

    static String swith(String s) {
        char old = s.charAt(0);
        char s1 = old == '1' ? '0' : '1';
        return s.replace(old, s1);
    }

    static int toInt(String target) {
        if (target.indexOf("1") > -1) {
            return 1;
        } else {
            return 0;
        }
    }
}
